// USER START (Optionally insert additional static code)
void changePhoto(WM_MESSAGE **pMsg, int index, int photo, int *record) {//record : 0-11
		hItem = WM_GetDialogItem((*pMsg)->hWin, GUI_ID_USER + index); //index : 1-12
		pData = _GetImageById(ID_IMAGE_0_IMAGE_0 + photo, &FileSize); //photo : 1-6
		IMAGE_SetBMP(hItem, pData, FileSize);
		record[photo] = (record[photo] < 2) ? record[photo] + 1 : record[photo];
		GUI_Exec();
}

void delay(int time, WM_MESSAGE *pMsg) {
		int temp = timerTick;
	
		time = (!time) ? 10 * number : time;
		while(timerTick - temp <= time) {
				delayTime();
				hItem = WM_GetDialogItem(pMsg->hWin, ID_EDIT_0);
				EDIT_SetText(hItem, time_str);
		}
}

void autoDisplay(WM_HWIN *hItem, WM_MESSAGE *pMsg, U32 *FileSize, const void *pData, int *order) {
		for(int i = ID_IMAGE_0; i <= ID_IMAGE_11; i++) {
				*hItem = WM_GetDialogItem(pMsg->hWin, i);
				pData = _GetImageById(ID_IMAGE_0_IMAGE_0 + order[i - ID_IMAGE_0], FileSize);
				IMAGE_SetBMP(*hItem, pData, *FileSize);
				GUI_Exec();
				HAL_Delay(10 * number);
				*hItem = WM_GetDialogItem(pMsg->hWin, i);
				pData = _GetImageById(ID_IMAGE_0_IMAGE_0, FileSize);
				IMAGE_SetBMP(*hItem, pData, *FileSize);
				GUI_Exec();
				HAL_Delay(10 * number);
		}
}

void check(WM_MESSAGE **pMsg, int *order, int *record) {
		int flag = 0;
		
		for(int i = 1; i < 7; i++) {
				if(record[i] == 1) {
						record[i] = 0;
						flag = 1;
				}
		}
		
		if(flag) {
				delay(150, *pMsg);
				changePhoto(pMsg, touched_record[1] - '0', 0, record);
				delay(150, *pMsg);
				changePhoto(pMsg, touched_record[0] - '0', 0, record);
				delay(150, *pMsg);
		}
}

bool recordTouch(int index, int photo) {
		if((touched_record[0] == index + '0' && record[photo] == 1 )|| record[photo] == 2) return 0;
		touched_record[1] = touched_record[0];
		touched_record[0] = index + '0';
		return 1;
}

void giveOrder(int *order) {
	int *repeat = malloc(sizeof(int) * PHOTONUM);
	int random;
	
	memset(order, 0, sizeof(int) * PHOTONUM);
	memset(repeat, 0, sizeof(int) * PHOTONUM);
	srand(timerTick);
	
	for(int i = 0; i < 12; i++) {
			random = (rand() % PHOTONUM) + 1;
			
			while(repeat[random - 1] == 2) {
					random = (rand() % PHOTONUM) + 1;
			}
			
			repeat[random - 1] += 1;
			order[i] = random;
	}
	
	free(repeat);
}

void resetGame(int *touched) {
		*touched = 0;
		memset(record, 0, sizeof(record));
		strcpy(touched_record, "");
}

void isFinish(int *touched) {
		finish = 1;
		
		for(int i = 1; i < 7; i++) {
				if(record[i] != 2) {
						finish = 0;
						break;
				}
		}
		
		if(finish) {
				resetGame(touched);
		}
}
